function GetMovies({ medium_cover_image, title, summary, genres }) {
  return (
    <div>
      {movies.map((movie) => (
        <div>
          <img src={medium_cover_image} />
          <h2>{title}</h2>
          <p>{summary}</p>
          <ul>
            {genres.map((genre, idx) => (
              <li key={idx}>{genre}</li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
}

export default GetMovies;
